import React from 'react';
import styled from 'styled-components';

const NowLogoutS = styled.div`
  cursor: pointer;
  text-align : center;
  line-height : 36px;
  width: 80px;
  height: 36px;
  border-radius: 12px;
  font-size: 16px;
  text-align: center;
  font-family:'bitbit';
  font-weight: 100;
  margin-left: ${(props) => props.marginLeft};
`;

function NowLogout() {
  return <>
    <NowLogoutS marginLeft="auto">로그인</NowLogoutS>
    <NowLogoutS marginLeft="-20px">회원가입</NowLogoutS>
  </>;
}

export default NowLogout;
